import React, { useState } from 'react';
import Navbar from './components/navbar';
import Hero from './components/hero';
import About from './components/about';
import Services from './components/services';
import Testimonials from './components/testimonials';
import PropertyListing from './components/propertylisting';
import Team from './components/team';
import Blog from './components/blog';
import FindAgent from './components/findagent';
import Contact from './components/contact';
import ParallaxSection from './components/parallaxsection';
import Footer from './components/footer';
import SignUp from './components/SignUpForm'; // Import the sign-up form
import './index.css';

function App() {
  // State to control form visibility
  const [isFormVisible, setFormVisible] = useState(false);

  // Function to show the form
  const showForm = () => {
    setFormVisible(true);
  };

  // Function to close the form
  const closeForm = () => {
    setFormVisible(false);
  };

  return (
    <div className="App">
      {/* Pass showForm as a prop to Navbar */}
      <Navbar onRegisterClick={showForm} />
      <Hero />
      <About />
      <Services />
      <Testimonials />
      <PropertyListing />
      <Team />
      <FindAgent />
      <Blog />
      <Contact />
      <ParallaxSection />
      
      {/* Show the sign-up form when isFormVisible is true */}
      {isFormVisible && <SignUpForm onClose={closeForm} />}

      <Footer />
    </div>
  );
}

export default App;
